import { describe, it, expect } from "vitest";
import { mount } from "@vue/test-utils";
import Sorderedlist from "../index.vue";

describe("Sorderedlist", () => {
  it("renders properly", () => {
    const wrapper = mount(Sorderedlist, {
      slots: {
        default: "Test Content"
      }
    });
    expect(wrapper.text()).toContain("Test Content");
  });

  it("renders the s-orderedlist web component", () => {
    const wrapper = mount(Sorderedlist, {
      slots: {
        default: "<s-list-item>Item 1</s-list-item>"
      }
    });

    const webComponent = wrapper.find("s-orderedlist");
    expect(webComponent.exists()).toBe(true);
  });

  it("passes slot content to the web component", () => {
    const testContent = "<s-list-item>First item</s-list-item><s-list-item>Second item</s-list-item>";
    const wrapper = mount(Sorderedlist, {
      slots: {
        default: testContent
      }
    });

    const webComponent = wrapper.find("s-orderedlist");
    expect(webComponent.exists()).toBe(true);
    expect(wrapper.html()).toContain("s-list-item");
  });
});
